import React, { Component } from 'react';

class Main extends React.Component{
  constructor(props) {
    super(props)
  }
  render(){
      return(
        <div>
        <ul>
          {
            this.props.projectsName && this.props.projectsName.map((project, i)=>{
                return (
                        <li key={i} className="objects">
                          <object width="500" height="400" data={project}>
                          </object>
                        </li>
                      )
              })
          }
          </ul>
        </div>
      )
  }
}

export default Main;
